import React from "react";

const Panel = ({ flx = "0 0 0", p = 0, h, classes = [], children }) => {
  return (
    <div
      className={`pnl-ctn`}
      style={{ flex: flx, padding: p, height: h ? h : "auto" }}
    >
      <div
        className={classes.reduce(
          (x, next) => x.toString() + " " + next.toString(),
          "pnl"
        )}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
